function changePrice(e){$.getJSON("https://cdn.jsdelivr.net/gh/shiraistore/assets@v1.1.73/json/feature/"+e+"_v1_0.json",function(e){$(".changePrice").each(function(){var a,i=$(this).data("products"),n=e.find(e=>e.productUrl===i);if(n){var s=n.sellingPrice,c=n.normalPrice;a=s<c?'<span class="mark-sale">SALE</span><span class="normalPrice">¥'+c.toLocaleString()+'（税込）</span><span class="sellingPrice salePrice">¥'+s.toLocaleString()+"（税込）</span>":'<span class="sellingPrice">¥'+s.toLocaleString()+"（税込）</span>",$(this).html(a)}})})}$(function(){var e=location.href;e.indexOf("/magazine/school-bag")>-1?changePrice("magazine-school-bag"):e.indexOf("/magazine/cabinet-stylish")>-1?changePrice("cabinet-stylish"):e.indexOf("/magazine/chest-stylish")>-1?changePrice("chest-stylish"):e.indexOf("/magazine/compact-tvboard")>-1?changePrice("compact-tvboard"):e.indexOf("/magazine/kitchen-strage-stylish")>-1?changePrice("kitchen-strage-stylish"):e.indexOf("/magazine/newLife")>-1&&changePrice("magazine-newLife")});